A Polícia Militar do Distrito Federal descartou a existência de um explosivo dentro de uma mochila abandonada no Setor Hoteleiro Norte, em Brasília, nesta terça-feira, 27. Ela foi deixada próximo de um depósito de gás, situado em um jardim próximo de um dos hotéis. Os agentes encontraram apenas roupas no interior da mochila. Segundo a PMDF, ela foi encontrada por volta das 16 horas, na Quadra 05 do Setor Hoteleiro. Por precaução, a polícia realizou a Operação Petardo, efetuada quando há uma suspeita de presença de um explosivo. O esquadrão antibomba foi acionado. Cerca de 300 policiais foram mobilizados. A PMDF confirmou ao site da Jovem Pan que este é o quinto caso suspeito de bomba nos últimos três dias,  e o 13º neste ano, e ocorrem às vésperas da posse do presidente eleito Luiz Inácio Lula da Silva (PT)
